# 1. 题目描述
给定一个整数数组 nums，返回数组 answer，其中 answer[i] 等于 nums 中除 nums[i] 之外其余各元素的乘积。
题目数据保证数组之中任意元素的全部前缀元素和后缀的乘积都在 32 位整数范围内。
请不要使用除法，且在 O(n) 时间复杂度内完成此题。

# 2. 示例
输入: nums = [1,2,3,4]
输出: [24,12,8,6]

输入: nums = [-1,1,0,-3,3]
输出: [0,0,9,0,0]

# 3. 解题思路
我们可以使用两个数组：left 和 right。
left[i] 表示索引 i 左侧所有元素的乘积（不包括 i），right[i] 表示索引 i 右侧所有元素的乘积（不包括 i）。
那么，answer[i] = left[i] * right[i]。

具体步骤：
1. 初始化 left 数组，长度与 nums 相同。left[0] 为 1（因为索引0左侧没有元素）。
2. 从左到右遍历 nums，对于每个位置 i（i从1开始），left[i] = left[i-1] * nums[i-1]。
3. 初始化 right 数组，长度与 nums 相同。right[n-1] 为 1（因为最后一个元素右侧没有元素）。
4. 从右到左遍历 nums，对于每个位置 i（i从n-2开始递减），right[i] = right[i+1] * nums[i+1]。
5. 最后，遍历每个位置，answer[i] = left[i] * right[i]。

# 4. 复杂度分析
- 时间复杂度：O(n)，其中 n 是数组长度。我们遍历了数组三次（一次计算left，一次计算right，一次计算answer）。
- 空间复杂度：O(n)，用于存储 left 和 right 数组。

# 5. 优化空间复杂度
我们可以将空间复杂度优化为 O(1)（不考虑返回数组的空间），只使用一个数组（即答案数组）来存储中间结果。
具体步骤：
1. 初始化 answer 数组，长度与 nums 相同。
2. 先将 answer 数组当作 left 数组：从左到右，answer[0]=1，然后 answer[i] = answer[i-1] * nums[i-1]。
3. 用一个变量 R 来记录右侧的乘积。初始时 R=1。
4. 从右向左遍历，对于每个位置 i，更新 answer[i] = answer[i] * R，然后更新 R = R * nums[i]（因为此时 nums[i] 是下一个元素的左侧部分，而 R 要累积右侧的乘积）。

