function productExceptSelf(nums) {
    const n = nums.length;
    const answer = new Array(n);

    // 初始化 answer[0] = 1
    answer[0] = 1;

    // 从左到右，计算左侧乘积
    for (let i = 1; i < n; i++) {
        answer[i] = answer[i-1] * nums[i-1];
    }

    // R 为右侧所有元素的乘积
    let R = 1;
    // 从右向左遍历
    for (let i = n-1; i >= 0; i--) {
        // 对于位置 i，answer[i] 已经是左侧乘积，乘以 R（右侧乘积）即可
        answer[i] = answer[i] * R;
        // 更新 R，乘以当前元素，为下一个元素（左边一个）的右侧乘积
        R *= nums[i];
    }

    return answer;
}

