    private void dfs(List<List<Integer>> result, List<Integer> list, int n, int k, int start) {
        if (list.size() == k) {
            result.add(new ArrayList<>(list));
            return;
        }
        for (int i = start; i <= n; i++) {
            list.add(i);
            dfs(result, list, n, k, i + 1);
            list.remove(list.size() - 1);
        }
    }
