// 1. 题目要求：给定一个整数数组 nums 和一个整数 k，返回数组中出现频率前 k 高的元素。
// 2. 注意：答案中元素可以按任意顺序返回。
// 3. 思路：使用哈希表统计频率，然后使用最小堆（优先队列）来维护前k个高频元素。
// 4. 具体步骤：
//    a. 遍历数组，用哈希表记录每个数字出现的频率。
//    b. 使用一个大小为k的最小堆，堆中元素为[频率, 数字]。
//    c. 遍历哈希表，将元素加入堆中，如果堆的大小超过k，则弹出堆顶（最小频率的元素），这样堆中保留的是频率最大的k个元素。
//    d. 最后将堆中的元素取出，由于堆顶是最小频率，所以取出的顺序无所谓，题目不要求顺序。
// 5. 复杂度：O(n log k)，因为每个元素插入堆的操作是O(log k)，n个元素。

#include <vector>
#include <unordered_map>
#include <queue>
using namespace std;

class Solution {
public:
    vector<int> topKFrequent(vector<int>& nums, int k) {
        // 统计频率
        unordered_map<int, int> frequency;
        for (int num : nums) {
            frequency[num]++;
        }

        // 定义最小堆，使用优先队列，pair的第一个元素是频率，第二个元素是数字
        // 由于是最小堆，所以需要比较频率，频率小的在堆顶
        auto cmp = [](const pair<int, int>& a, const pair<int, int>& b) {
            return a.first > b.first; // 注意：比较的是频率，频率大的应该下沉，所以用大于号
        };
        priority_queue<pair<int, int>, vector<pair<int, int>>, decltype(cmp)> minHeap(cmp);

        // 遍历哈希表
        for (auto& [num, count] : frequency) {
            minHeap.push({count, num}); // 注意：这里把频率放在pair的第一个位置，因为我们要按频率比较
            if (minHeap.size() > k) {
                minHeap.pop(); // 如果堆的大小超过k，弹出堆顶（当前最小频率的元素）
            }
        }

        // 取出结果
        vector<int> res;
        while (!minHeap.empty()) {
            res.push_back(minHeap.top().second); // 取出数字
            minHeap.pop();
        }
        // 注意：由于堆是最小堆，弹出的顺序是从小到大（按频率），但题目不要求顺序，所以直接返回即可。
        // 但通常我们会希望从高到低？题目没有要求顺序，所以可以任意顺序。
        return res;
    }
};

// 测试
int main() {
    Solution sol;
    vector<int> nums = {1,1,1,2,2,3};
    int k = 2;
    vector<int> res = sol.topKFrequent(nums, k);
    // 输出结果
    for (int num : res) {
        printf("%d ", num);
    }
    // 预期输出: 1 2 或者 2 1，顺序无所谓
    return 0;
}

