// 1. **Problem Analysis**: The problem requires us to find the maximum number of consecutive 1's in a binary array `nums` after flipping at most `k` zeros to ones. The flipping operation is allowed at most `k` times, meaning we can convert up to `k` zeros to ones to form the longest possible sequence of consecutive ones.

// 2. **Intuition**: The solution involves using a sliding window technique. The idea is to maintain a window that can contain at most `k` zeros. As we expand the window by moving the right pointer, we count the zeros encountered. If the number of zeros exceeds `k`, we shrink the window from the left until the zeros are within the allowed limit (`k`). The maximum window size encountered during this process is our answer.

// 3. **Algorithm Selection**: 
//    - **Sliding Window (Two Pointers)**: We use two pointers, `left` and `right`, to represent the current window. We also maintain a `zeroCount` to track the number of zeros in the current window.
//    - **Expansion**: Move the `right` pointer to include elements in the window. For each zero encountered, increment `zeroCount`.
//    - **Contraction**: If `zeroCount` exceeds `k`, move the `left` pointer to the right until `zeroCount` is no more than `k`. For each zero left behind, decrement `zeroCount`.
//    - **Update Answer**: After each adjustment, update the maximum window size (`ans = max(ans, right - left + 1)`).

// 4. **Complexity Analysis**: 
//    - **Time Complexity**: O(n), where `n` is the length of the array. Each element is processed at most twice (once by the right pointer and once by the left pointer).
//    - **Space Complexity**: O(1), as we only use a few extra variables.

// 5. **Code Implementation**:
class Solution {
public:
    int longestOnes(vector<int>& nums, int k) {
        int left = 0, right = 0;
        int zeroCount = 0;
        int ans = 0;

        for (; right < nums.size(); right++) {
            if (nums[right] == 0) {
                zeroCount++;
            }

            while (zeroCount > k) {
                if (nums[left] == 0) {
                    zeroCount--;
                }
                left++;
            }

            ans = max(ans, right - left + 1);
        }

        return ans;
    }
};

