//    - We initialize `left` and `right` pointers at the start of the array.
//    - As we iterate over the array with `right`, we check if the current element is zero. If it is, we increment `zeroCount`.
//    - If `zeroCount` exceeds `k`, we move the `left` pointer forward until `zeroCount` is back to at most `k`. For each zero encountered by `left`, we decrement `zeroCount`.
